import React, { useEffect, useState } from 'react';
import './appointment.css'

const Appointments = ({ userEmail }) => {
  const [appointments, setAppointments] = useState([]);

  useEffect(() => {
    fetch(`http://localhost:5000/api/appointments/${userEmail}`)
      .then((res) => res.json())
      .then((data) => setAppointments(data))
      .catch((err) => console.error('Failed to fetch:', err));
  }, [userEmail]);

  return (
    <div className="appointments-page">
      <h2>Your Appointments</h2>
      {appointments.length === 0 ? (
        <p>No appointments found.</p>
      ) : (
        appointments.map((apt, index) => (
          <div key={index} className="appointment-card">
            <h3>{apt.mainService}</h3>
            <p>Sub-Service: {apt.subService}</p>
            <p>Name: {apt.name}</p>
            {apt.spouseName && <p>Spouse: {apt.spouseName}</p>}
            {apt.childName && <p>Child: {apt.childName}</p>}
            <p>Date: {apt.date}</p>
            <p>Time: {apt.time}</p>
            <p>Contact: {apt.mobile}</p>
            <p>Email: {apt.email}</p>
          </div>
        ))
      )}
    </div>
  );
};

export default Appointments;
